import React from "react";
import "./styles.css";

function App() {
  return (
    <div>
      <Header />
      <h1>Grocery List</h1>
      <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike"/>
      <label for="vehicle1"> Spinach</label><br/>
      style={{ fontStyle: "oblique", fontSize: 60 }}
      <input type="checkbox" id="vehicle2" name="vehicle2" value="Car"/>
      <label for="vehicle2"> Toilet Paper</label><br/>
    </div>
  );
}

function Header() {
  var nameFirst = "Jihun";
  var nameLast = "Park";

  return <h1 className="header"
  style={{ fontStyle: "oblique", fontSize: 60 }}
  >Welcome to the Twilight Zone { nameFirst } { nameLast }</h1>
}


export default App;
